import React from "react";
import { Field, reduxForm } from "redux-forms";

const CreateStream = () => {
  const renderInput = ({ formProps }) => {
    return <input {...formProps} />;
  };
  return <div>{renderInput}</div>;
};

export default reduxForm({ form: "createStream" })(CreateStream);
